  //     setWeeklyInfo(result.data);
  //     console.log("printing data after await");
  //     console.log(result.data);
  fetchWeeklyInfo();

  return (
    <WeeklyInfoContext.Provider value={weeklyInfo}>
      {children}
    </WeeklyInfoContext.Provider>
  );
}
export default WeeklyInfoProvider;
